import groq from "groq"
import { getClient, getGlobalData } from '../lib/sanity/sanity.server'
import React from "react"
import anime from "animejs"
import Image from "../components/image"
import Link from "next/link"
import Layout from "../components/layout"

export default function Home({ homePage, global, locale }) {
  return (
    <Layout data={global}>

      {/* Landing Section */}
      <div className=" h-screen w-full relative">

        <LandingImage
          className="absolute w-full h-full"
          image={homePage.landingImage}
        />

        <div className="absolute bottom-[5vh] w-full flex flex-col items-center">

          <LandingTitle className="mb-5 md:mb-12">
            {homePage.title}
          </LandingTitle>

          <div className="flex flex-col items-center gap-5 md:flex-row md:mb-3">
            <LandingCTA className="bg-primary4" cta={homePage.callToAction1} />
            <LandingCTA cta={homePage.callToAction2} />
          </div>

          <LandingArt className="h-44 hidden md:block"/>
        </div>
      </div>

      <HomeNavigation data={homePage.navigation} />
    </Layout>
  )
}

const LandingTitle = ({ className, children }) => {
  return (
    <>
      <h1 className={`font-header text-6xl md:text-9xl font-black text-center text-white ${className}`}>
        {children}
      </h1>
    </>
  )
}

const LandingCTA = ({ className, cta }) => {
  return (
    <>
      <Link href={cta.slug}>
        <a className={`button ${className}`}>
          {cta.text}
        </a>
      </Link>
    </>
  )
}

const LandingImage = ({ className, image }) => {
  return (
    <Image
      className={`${className}`}
      objectFit="object-cover"
      image={image}
      sizes={[600, 1500, 4000]}
      loading="eager"
    />
  )
}

const HomeNavigation = ({ data }) => {
  return (
    <div className="grid grid-cols-12 grid-rows-[repeat(6,20rem)] pointer-events-none md:grid-rows-[repeat(4,22rem)] lg:grid-rows-[repeat(4,25rem)]">
      {data.map((element, index) =>
        <HomeNavigationItem index={index} data={element} key={`HomeNavigationItem${index}`} />
      )}
    </div>
  )
}

const HomeNavigationItem = ({ data, index }) => {
  const getColumnSpan = (index) => {
    if (index == 0) {
      return "col-span-full lg:col-span-8"
    } else if (index == 1) {
      return "col-span-full md:col-span-6 lg:col-span-4"
    } else if (index == 2) {
      return "col-span-full md:col-span-6 lg:col-span-4"
    } else if (index == 3) {
      return "col-span-full md:col-span-5 lg:col-span-5"
    } else if (index == 4) {
      return "col-span-full md:col-span-7"
    } else if (index == 5) {
      return "col-span-full lg:col-span-7"
    }
  }

  const getRowSpan = (index) => {
    if (index == 0) {
      return "lg:row-span-2"
    } else if (index == 1) {
      return ""
    } else if (index == 2) {
      return ""
    } else if (index == 3) {
      return "lg:row-span-2"
    } else if (index == 4) {
      return ""
    } else if (index == 5) {
      return ""
    }
  }

  //ANIMATION
  const DURATION = 1000
  const SCALE = { FROM: 1, TO: 1.2 }
  const OPACITY = { FROM: 0.4, TO: 0.2 }
  const EASING = "easeInOutSine"

  const onMouseEnter = () => {
    anime({
      targets: `#HomeNavigationItemImage${index}`,
      scale: SCALE.TO,
      easing: EASING,
      duration: DURATION
    });

    anime({
      targets: `#HomeNavigationItemBackground${index}`,
      opacity: OPACITY.TO,
      easing: EASING,
      duration: DURATION
    });
  }

  const onMouseLeave = () => {
    anime({
      targets: `#HomeNavigationItemImage${index}`,
      scale: SCALE.FROM,
      easing: EASING,
      duration: DURATION
    });

    anime({
      targets: `#HomeNavigationItemBackground${index}`,
      opacity: OPACITY.FROM,
      easing: EASING,
      duration: DURATION
    });
  }


  return (
    <Link href={data.slug}>
      <a className={`${getRowSpan(index)} ${getColumnSpan(index)} pointer-events-auto grid place-items-center relative overflow-hidden`}
        onMouseEnter={onMouseEnter}
        onMouseLeave={onMouseLeave}
      >

        <Image className="absolute w-full h-full"
          id={`HomeNavigationItemImage${index}`}
          image={data.image}
          sizes={[1000, 2000]}
          objectFit='object-cover'
        />

        <div className="absolute w-full h-full bg-black opacity-40 group-hover:opacity-10"
          id={`HomeNavigationItemBackground${index}`}
        />

        <h2 className="font-header font-bold text-3xl md:text-4xl text-white pointer-events-none z-10 drop-shadow-2xl">
          {data.text}
        </h2>
      </a>
    </Link>
  )
}

